import React, { Component } from 'react'
import {
  Grid
} from '@material-ui/core'
import { connect } from 'react-redux'
import compose from 'recompose/compose'
import Fab from '@material-ui/core/Fab'
// import image from '../assets/modelX.png'
import modelS from '../assets/modelS.png'
import blackCar from '../assets/MS-Specs-Hero-Desktop\ 1.png'
import ModelSpecView from './ModelDetailsGridView'
import TopBottomTextView from './MinimalSpecView/TopBottomTextView'
import {fetchModelDetails} from '../actions'

class ModelOrderConfiguration extends Component {
    constructor(props) {
        super(props)

        this.onOrderClick = this.onOrderClick.bind(this);
      }

  componentWillReceiveProps(nextProps) {

  }

  onOrderClick = () => {
    const {history} = this.props

    history.push('/modelOrder')
  }

  componentDidMount() {
    // const { location } = this.props
    // const { modelName } = location.state
    // const { getModelDetails } = this.props

    // getModelDetails(modelName)
  }


  render() {
    const { modelName, modelConfig } = this.props;

    console.log('Model config:::',modelConfig)

    return (
        <div>
        <Grid container direction='row' justifyContent='center'>
                <Grid item>
                    <span class='modelName'>
                    {modelName}
                    </span>
                </Grid>
                <Grid item>
                  <Grid conatiner direction='column' spacing={2}>
                    <Grid item>
                        <TopBottomTextView topData={modelConfig.range} bottomData="Est Range" />
                    </Grid>
                    <Grid item>
                        <TopBottomTextView topData={modelConfig.range} bottomData="Est Range" />
                    </Grid>
                    <Grid item>
                        <TopBottomTextView topData={modelConfig.range} bottomData="Est Range" />
                    </Grid>
                  </Grid>
                </Grid>
            </Grid>
        </div>
    )
  }
}

/**
 * Function to call the action to call API to send login credentials for verification
 */
function mapDispatchToProps(dispatch) {
  return {
      getModelDetails: (model) => dispatch(fetchModelDetails(model))
  }
}
/**
 * Function to receive the state of login api call response
 */
function mapStateToProps(state) {
  return {
    modelData: state.allCarReducer.selectedModelData
  }
}

export default compose(
  connect(
    mapStateToProps,
    mapDispatchToProps
  )
)(ModelOrderConfiguration)
